import {
  BrowserRouter as Router,
  Routes,
  Route,
  Switch,
} from "react-router-dom";
import "./App.css";
import S01Screen from "./components/S01Screen/S01Screen";
import S02Screen from "./components/S02Screen.js/S02Screen";

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/" exact element={S01Screen}></Route>
        <Route path="/s01" element={S01Screen}></Route>
        <Route path="/s01" element={S02Screen}></Route>
      </div>
    </Router>
  );
}

export default App;
